import React from 'react'
import './About.css'

export default function About() {
  const img="https://www.deputy.com/uploads/2018/10/The-Most-Popular-Menu-Items-That-You-should-Consider-Adding-to-Your-Restaurant_Content-image1-min-1024x569.png"
  return (
    <div style={{backgroundImage:'url("https://dynamic-media-cdn.tripadvisor.com/media/photo-o/06/fe/db/b1/ministry-of-food.jpg?w=1200&h=-1&s=1")', height:750, backgroundSize:'cover'}}>
      {/* <h1>About US</h1> */}
      <div>
        <div className='img'>
          <img src={ img}/>
        </div>
      </div>
    </div>
  )
}
